import './App.css';

function App() {
  return (
    <div className="App">
      <User name="Adrian" age={20} email="adrian@adrian.com"/>
      <User name="Mateusz" age={24} email="mateusz@adrian.com"/>
      <User name="Janusz" age={32} email="janusz@adrian.com"/>
    </div>
  );
}
const User = (props) => {
  return(
    <div>
      <h1>Adrian</h1>
      <h2>20</h2>
      <h2>adrian@adrian.com</h2>    
    </div>
  );
}
export default App;
